import Register from "../../assets/Register.svg";
import { ContainerImage } from "./styles";

export const RegisterImage = () => {
  return (
    <>
      <ContainerImage className="hidden">
        <img src={Register} alt="register" />
      </ContainerImage>
    </>
  );
};
